window.bookSummaryJSON = "<p><b>Alison is pregnant and Harker should be the happiest man alive, except she hates him.</b><br> <br> He’ll do anything she wants him to do except the one thing she asks, to let her go.<br> <br> Alison wants nothing to do with Harker ever again but she’s bound by the contract to stay with him. Worse than that, her body doesn’t care that he betrayed her. It wants him – his touch, his kiss, his love.<br> <br> Can she stay away from him until she has their child or will she cave into her desire?</p>"; 
